import { Form } from "./Form";


const App = () =>{


    return(
        <html className="App">
            <header className="App-header">
                <p ><div>Flight Services</div>
                    </p>
            </header>
            <body style="text-align:center;">
            <Form></Form>
            </body>
        </html>
    );
}

export default App;
